"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Aortic coarctation in children (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/aortic-coarctation-in-children-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H12130658\">",
"      <span class=\"h1\">",
"       What is aortic coarctation in children?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Aortic coarctation",
"      <strong>",
"      </strong>",
"      is a problem that causes the heart&rsquo;s largest vessel, called the &ldquo;aorta,&rdquo; to narrow (",
"      <a class=\"graphic graphic_figure graphicRef82985 \" href=\"UTD.htm?34/19/35124\">",
"       figure 1",
"      </a>",
"      ). Children with aortic coarctation are born with the problem.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12130673\">",
"      <span class=\"h1\">",
"       What are the symptoms of aortic coarctation in children?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most babies and children have no symptoms. In some cases, a routine imaging test (called an &ldquo;ultrasound&rdquo;) that women have during pregnancy might show the baby has narrowing of the aorta.",
"     </p>",
"     <p>",
"      Newborn infants with severe narrowing of the aorta might have symptoms that include: &nbsp;",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pale skin",
"       </li>",
"       <li>",
"        Crying and fussing more than normal",
"       </li>",
"       <li>",
"        Sweating",
"       </li>",
"       <li>",
"        Trouble breathing",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Older babies and children can have symptoms, especially when they are physically active, including:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Chest pain or leg cramps",
"       </li>",
"       <li>",
"        Cold hands and feet",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12130688\">",
"      <span class=\"h1\">",
"       Are there tests for aortic coarctation in children?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor will do an exam and measure your child&rsquo;s pulse and blood pressure in his or her arms and legs. Children with this condition have a weaker pulse and lower blood pressure in their legs than in their arms. &nbsp;",
"     </p>",
"     <p>",
"      Other tests include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        An electrocardiogram &ndash; This test measures the electrical activity of the heart. It is also called an &ldquo;ECG&rdquo; or &ldquo;EKG.&rdquo;",
"       </li>",
"       <li>",
"        An echocardiogram &ndash; This test uses sound waves to take pictures of the heart and aorta.",
"       </li>",
"       <li>",
"        An MRI or CT scan &ndash; These tests take pictures of the heart and aorta.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12130703\">",
"      <span class=\"h1\">",
"       How is aortic coarctation in children treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The treatment will depend on your child&rsquo;s age, size, and symptoms. Newborns with serious symptoms might need medicines given through a vein (called an &ldquo;IV&rdquo;).",
"     </p>",
"     <p>",
"      Other treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Angioplasty&nbsp;&ndash; A doctor puts a thin tube into a blood vessel in the leg or arm and advances the tube to the aorta. Then the doctor inflates a balloon inside the aorta to widen it. In older children, the doctor may prop open the aorta using a mesh tube called a &ldquo;stent.&rdquo;",
"       </li>",
"       <li>",
"        Surgery&nbsp;&ndash; Different types of surgery can fix the narrowed aorta. The doctor might remove the narrowed part of the aorta. In other cases, he or she uses a plastic tube called a &ldquo;graft&rdquo; or a piece of another one of your child&rsquo;s blood vessels to fix the aorta.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12130719\">",
"      <span class=\"h1\">",
"       What will my child&rsquo;s life be like?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many children with aortic coarctatation are able to live normal lives. But aortic coarctation can return after treatment. This means your child will need to see his or her doctor on a regular basis. How often will depend on your child&rsquo;s condition. Also, you should check with your doctor about whether your child should not do certain activities or sports.",
"     </p>",
"    </div>",
