"      Mirena (AR, AT, AU, BB, BE, BG, BM, BS, BZ, CH, CO, CR, CZ, DE, DO, EC, ES, GB, GT, GY, HK, HN, HU, ID, IE, IL, IT, JM, LU, MY, NI, NL, NZ, PA, PE, PH, PR, RU, SR, SV, TT, UY, ZA);",
"     </li>",
