"      Norlevo (AU, DK, ES, FI, FR, GR, IL, IN, KP, NO, PT, SE, SG, TR, ZA);",
"     </li>",
"     <li>",
"      Norplant (CL, LU, PH, TH, TW);",
"     </li>",
"     <li>",
"      Pill 72 (HK);",
"     </li>",
"     <li>",
"      Plan B (DO, HN, NI, SV);",
