"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F188163\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Pregnancy may be prevented through several mechanisms: Thickening of cervical mucus, which inhibits sperm passage through the uterus and sperm survival; inhibition of ovulation, from a negative feedback mechanism on the hypothalamus, leading to reduced secretion of follicle stimulating hormone (FSH) and luteinizing hormone (LH);  and inhibition of implantation. Levonorgestrel is not effective once the implantation process has begun.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F188181\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: Intrauterine device: Mirena&reg;: Up to 5 years; Skyla&trade;: Up to 3 years",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Oral: Rapid and complete",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : ~1.8 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: Highly bound to albumin (~50%) and sex hormone-binding globulin (~47%)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic via CYP3A4; forms inactive metabolites",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Oral: ~24 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: Oral: ~2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (45%); feces (32%)",
"    </p>",
"   </div>",
"  </div>",
