var title_f24_47_25341="AVR survival and CAD";
var content_f24_47_25341=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F77139&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F77139&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Survival after aortic valve replacement in aortic stenosis with left ventricular dysfunction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 356px; height: 241px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Kaplan-Meier survival curves show that patients with aortic stenosis and left ventricular dysfunction who undergo aortic valve replacement have a survival which is similar to that expected in the overall population in the absence of significant coronary artery disease (CAD, defined as &ge;2 vessel disease or left main disease). In contrast, survival is reduced when significant CAD is present.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Connolly HM, Oh JK, Orszulak TA, et al. Circulation 1997; 95:2395.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
